import React from "react";
import {DiPhp} from "react-icons/di";
import dog from "./dog.jpg";
import "./card.css";

export class Card extends React.Component{
    render(){
        return(
            <div>
                <div>
                    <label><DiPhp /></label>
                    <label>Beginners</label>
                    <h3>Fun with PHP</h3>
                </div>
               <p><span>by</span> <img src={dog} alt=""/> <span>Darrell Steward</span></p>
            </div>
        );
    }
}
